import { React } from "react";
import { LoggedInNavbar } from "./LoggedInNavbar";
import { LoggedOutNavbar } from "./LoggedOutNavbar";
import './Navbar.css'

export const Navbar = (props) => {

    return (
        <>
            {props.loggedIn === "0" ? <LoggedInNavbar/> : <LoggedOutNavbar/>}
        </>
    )
}
